type parameters struct {
	nums []int
}

func Test1(t *testing.T) {

	params := parameters{nums: []int{1, 1, 0, 1, 1, 1}}

	expected := 3

	if testResult := findMaxConsecutiveOnes(params.nums); reflect.DeepEqual(expected, testResult) {
		t.Log("success")
	} else {
		t.Error("fail coz expected is ", expected, " and test result is ", testResult)
	}
}

